import { useState } from "react";
import "../css/price-range.css";

const PriceRange = () => {
  const [value, setValue] = useState({ start: 0, end: 100 });
  console.log(value);
  const increaseStart = (e) => {
    console.log("moved");

    let newValue = value;
    newValue.start += 1;
    setValue(newValue);
  };

  return (
    <div className="slider-range d-flex">
      <input
        disabled
        onPointerMove = {() => increaseStart()}
        className="start-range"
      ></input>
      <div className="end-range"></div>
    </div>
  );
};

export default PriceRange;
